import React from "react";

const ObjectPage = ({ id, onBack }) => {
  return (
    <div>
      <h1>Reimbursement Details</h1>
      <p>Reimbursement ID: {id}</p>
      {/* You can use the ID to fetch more details about the reimbursement if needed */}
      <Button variant="contained" color="secondary" onClick={onBack}>
        Back to List
      </Button>
    </div>
  );
};

export default ObjectPage;
